        super(props);
        this.state = {
            employee:[]
        }
      }
      componentDidMount()
      {
        fetch('https://mocki.io/v1/8b58f489-d1d2-4b4c-b2bd-02c0603c8112')
        .then(response => response.json())
        .then(result => {
            this.setState({employee: result})
        })
        .catch(e => {
            console.log(e);
        });

      }
    render(){

        return(
        <div>
            {/*----------------------Navbar----------------- */}

