                    <a class="nav-link" href="#">
                      <h5>Dashboard</h5></a>
                </li>
                <li class="nav-item">
                    <a class="nav-link" href="#" style={{paddingLeft:"2"}}><h5>About</h5></a>
                </li>
            </ul>
        </nav><br />
         {/*----------------------Navbar Ends----------------- */}

         {/*---------------- Side Bar------------------- */}
        <div class="container-fluid">
            <div class="row">
                <div class="col-md-2">
                    <div class="card" id="mc">
                        <div class="card-body" id="maincard">
                        </div>
                    </div>
               </div>

        {/*----------Main Content------------------------ */}
                <div class="col-md-10 ">
               <div>
               <ul className="list-group">
               {JSON.parse(this.state.employee).map((emp)=>{
                  <li><h2>{emp.id}</h2></li>
               })
               }
               </ul>
                </div>

                <div class="card" id="mc">
                        <div class="card-body" id="maincard">
                        </div>
